import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Hdata from "./DOH"
ReactDOM.render(
<>
<App 

	IS={Hdata[0].IS}
	HN={Hdata[0].HN}
	HP={Hdata[0].HP}
	/>
<App
	IS={Hdata[1].IS}
	HN={Hdata[1].HN}
	HP={Hdata[1].HP}
 />
<App

	IS={Hdata[2].IS}
	HN={Hdata[2].HN}
	HP={Hdata[2].HP}
/>

</>
, document.getElementById('root'));
